// ignore_for_file: depend_on_referenced_packages

import 'package:flutter/material.dart';
import 'package:flutter/services.dart';
import 'package:flutter_ezw_lc3/flutter_ezw_lc3.dart';
import 'package:flutter_ezw_lc3/lc3_codec.dart';

/// 测试用lc3字节流（已编码）
const mic =
    "";

void main() {
  runApp(const MyApp());
}

class MyApp extends StatefulWidget {
  const MyApp({super.key});

  @override
  State<MyApp> createState() => _MyAppState();
}

class _MyAppState extends State<MyApp> {
  final _flutterEzwLc3Plugin = FlutterEzwLc3();

  String pcm = "";

  @override
  void initState() {
    super.initState();
  }

  @override
  Widget build(BuildContext context) => MaterialApp(
        home: Scaffold(
          appBar: AppBar(
            title: const Text('Plugin example app'),
          ),
          body: SingleChildScrollView(
            child: TextButton(
              onPressed: () async {
                final pcmCodes = await decodeLc3(
                    streamBytes: Uint8List.fromList(mic.codeUnits));
                setState(() {
                  pcm = pcmCodes?.map((e) => e.toRadixString(16)).join(" ") ?? "";
                });
              },
              child: Center(
                child: Text('Lc3: $mic\ndecode\nPCM: $pcm'),
              ),
            ),
          ),
        ),
      );
}
